import {BlockElementIcon} from '@sanity/icons'

export default {
  name: 'header',
  title: 'Header',
  type: 'document',
  icon: BlockElementIcon,
  fields: [
    {
        name: 'headline',
        title: 'Headline',
        type: 'string',
        description: 'Please limit to 100 characters',
        options: {
            maxLength: 100,
        }
    },
    {
        name: 'subline',
        title: 'Subline',
        type: 'text',       
    },
    {
      name: 'image',
      title: 'Image',
      type: 'image',
      options: {
        hotspot: true,
      },
    },
  ],
  preview: {
    select: {title: 'name', media: 'image'},
  },
}

