sourcesContent:
import {ComposeIcon} from '@sanity/icons'

export default {
  name: 'article',
  title: 'Article',
  type: 'document',
  icon: ComposeIcon,
  fields: [
    {
      name: 'title',
      title: 'Article Title',
      type: 'string',
    },
    {
      name: 'slug',
      title: 'Slug',
      type: 'slug',
      options: {
        source: 'title',
        maxLength: 200, // will be ignored if slugify is set
        slugify: input => input
          .toLowerCase()
          .replace(/\s+/g, '-')
          .slice(0, 200)
      }
    },
    {
      name: 'summary',
      title: 'Summary',
      type: 'text',
    },
    {
      name: 'content',
      title: 'Content',
      type: 'blockContent',
    },

  ],
  preview: {
    select: {title: 'headline', media: 'icon'},
  },
}
